function decodeBase64(b64string) {
    const byteString = atob(b64string);
    const len = byteString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
        bytes[i] = byteString.charCodeAt(i);
    }
    return bytes;
}

